import React, {Component} from 'react'
import axios from 'axios'

class ResultDetails extends Component {
    constructor(props) {
        super(props)

    }

    handleClick = () => {
      console.log('clicked')
        // <Link to=""> </Link>
    }

render() {
    const result = this.props.result
    return (
        <div key={this.props.index}>
        <h4 onClick="handleClick">{result.name}</h4>
        <h5>{result.artist}</h5>
        <img size={result.size} src= {decodeURI(result.image)} />
      <p>Listeners: {Number(result.listeners).toLocaleString('en')}</p>
      <a href={result.url}>last.fm Profile</a>
    </div>
    )
}
}

export default ResultDetails;
